import React from "react";
import ReactDOM from "react-dom";
import "./Stylesheet.css";
import SliderCollection from "./Sliders";
import { LessDetailedAtomicElement } from "./ElementRepresentation";

ReactDOM.render(
    <div>
        <LessDetailedAtomicElement symbol="Gt" atomicNumber="9" type="no-type" />
        <LessDetailedAtomicElement symbol="R" atomicNumber="89" type="alkali" />
        <SliderCollection />
    </div>,
    document.getElementById("app"));
